import React, { useEffect } from 'react';
import { NavLink } from 'react-router-dom';

const ArshaComponent = () => {
  useEffect(() => {
    function page() {
      // Copy your script logic here
      // For example, you can include AOS initialization
      // and any other script logic from the original HTML file
    }

    // Call the function on component mount
    page();
  }, []);

  return (
    <>
      <header id="header" className="fixed-top">
        <div className="container d-flex align-items-center">
          <h1 className="logo me-auto">
            <NavLink to="/">Arsha</NavLink>
          </h1>

          <nav id="navbar" className="navbar">
            <ul>
              <li><NavLink className="nav-link scrollto active" to="#hero">Home</NavLink></li>
              <li><NavLink className="nav-link scrollto" to="#about">About</NavLink></li>
              <li><NavLink className="nav-link scrollto" to="#services">Services</NavLink></li>
              <li><NavLink className="nav-link scrollto" to="#contact">Contact</NavLink></li>
              <li><NavLink className="getstarted scrollto" to="#about">Get Started</NavLink></li>
            </ul>
            <i className="bi bi-list mobile-nav-toggle"></i>
          </nav>
        </div>
      </header>

      <section id="hero" className="d-flex align-items-center">
        <div className="container">
          <div className="row">
            <div className="col-lg-6 d-flex flex-column justify-content-center pt-4 pt-lg-0 order-2 order-lg-1" data-aos="fade-up" data-aos-delay="200">
              <h1>Better Solutions For Your Business</h1>
              <h2>We are a team of talented designers making websites with Bootstrap</h2>
              <div className="d-flex justify-content-center justify-content-lg-start">
                <NavLink to="#about" className="btn-get-started scrollto">Get Started</NavLink>
                <a href="https://www.youtube.com/watch?v=jDDaplaOz7Q" className="glightbox btn-watch-video"><i className="bi bi-play-circle"></i><span>Watch Video</span></a>
              </div>
            </div>
            <div className="col-lg-6 order-1 order-lg-2 hero-img" data-aos="zoom-in" data-aos-delay="200">
              <img src="assets/img/hero-img.png" className="img-fluid animated" alt="" />
            </div>
          </div>
        </div>
      </section>

      {/* Add the rest of your sections and content here */}

      {/* Vendor JS Files */}
      <script src="assets/vendor/aos/aos.js"></script>
      <script src="assets/vendor/bootstrap/js/bootstrap.bundle.min.js"></script>
      <script src="assets/vendor/glightbox/js/glightbox.min.js"></script>
      <script src="assets/vendor/isotope-layout/isotope.pkgd.min.js"></script>
      <script src="assets/vendor/swiper/swiper-bundle.min.js"></script>
      <script src="assets/vendor/waypoints/noframework.waypoints.js"></script>
      <script src="assets/vendor/php-email-form/validate.js"></script>
    </>
  );
};

export default ArshaComponent;
